import React from "react";
// import "./About.css";

function About() {
  return (
    <div className="about">
      <h1>About Us</h1>
      <p>Hello, wishes from cheriehomes@gmail.com</p>
      <br />
      <p>
      The  is different by design. Our work is much more than real estate. Our work is your life, your dreams, and building your legacy. We will be the catalyst for change in real estate by revolutionizing the way the industry does business and serves others.
      </p>


      <br />

      <h3>Browse through some of our houses video</h3>
      <br />
      <div className="videos">
        <iframe
          width="560"
          height="315"
          src="https://www.google.com/search?q=modern+home+video+google&ei=2TQfY8fYJfiVxc8Pyu-CuAE&oq=modern+home+video+goo&gs_lcp=Cgdnd3Mtd2l6EAEYADIFCCEQoAEyBQghEKABMgUIIRCgATIFCCEQoAEyBQghEKABMggIIRAeEBYQHTIICCEQHhAWEB0yCAghEB4QFhAdMggIIRAeEBYQHTIICCEQHhAWEB06CggAEEcQ1gQQsAM6DQgAEEcQ1gQQsAMQyQM6BQgAEIAEOgYIABAeEBY6CAgAEB4QDxAWOgUIABCGA0oECEEYAEoECEYYAFCbBViGD2DdHWgBcAF4AIABuwKIAfwIkgEFMi0yLjKYAQCgAQHIAQjAAQE&sclient=gws-wiz"
          title="YouTube video player"
          frameborder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowfullscreen
        ></iframe>

      </div>
    </div>
  );
}
export default About;
